-- 1. CREAR UNA TABLA

DROP TABLE IF EXISTS Consulta;

CREATE TABLE Consulta (
    
  numeroConsulta TEXT(10) NOT NULL,
  fecha          TEXT     NOT NULL,
  nombreMedico   TEXT(50) NOT NULL,
  deinpr         TEXT(20) NOT NULL,
  procedencia    TEXT(20) NOT NULL,
                 PRIMARY KEY (numeroConsulta)
);

